import React from 'react';
import Header from '../../components/Header/Header';
import Cart from '../../components/Cart/Cart';
import Footer from '../../components/Footer/Footer';


const PaymentCancelPage = () => {
  return (
    <>
      <Header />
      <Cart />
      <section className=" p-t-104 p-b-116">
      <div className="container">
        <div className="flex-w flex-c-m">
          <div className="size-210 bor2 p-lr-70 p-t-55 p-b-70 flex-c-m bg1" style={{backgroundColor: "#efefef"}}>
            <img src="poto/cancel.png" className="img-fluid" width="100" />
            <h4 className="p-l-15 mtext-103">Your Payment <span className="text-danger">Cancel!</span></h4>
          </div>
        </div>
      </div>
    </section>
      <Footer />

      {/* <!-- Back to top --> */}
      <div className="btn-back-to-top" id="myBtn">
        <span className="symbol-btn-back-to-top">
          <i className="zmdi zmdi-chevron-up"></i>
        </span>
      </div>
    </>
  )
}

export default PaymentCancelPage;
